import React from 'react'



export const FileCard = ({ file }) => {
    file = file[0]
    console.log(file.link)
    return (
        <>
            {/* <div className="card mb-3 justify-content-center align-items-center"> */}
            <div className="card mb-3 ">
                <img src={file.link} className="card-img-center w-25 p-3 mx-auto" alt="..." />
                <div className="card-body">
                    <h5 className="card-title font-weight-bold">Ваша фотография</h5>
                    <p className="card-text">Сылка: <a href={file.link}>{file.link}</a></p>
                    <p className="card-text">Дата создания: <p>{new Date(file.data).toLocaleDateString()}</p></p>
                    {/* <p className="card-text"><small className="text-muted">Last updated 3 mins ago</small></p> */}
                </div>
            </div>
        </>
    )
}
